import { useState } from "react";
import { Axios } from "axios";

const Detail = () => {
  const [user, setUser] = useState([]);
  const getId = localStorage.getItem("id");

  useEffect(() => {
    Axios
      .get(`https://jsonplaceholder.typicode.com/users/${getId}`)
      .then((res) => {
        console.log(res);
        setUser(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  });

  return (
    <>
      <div></div>
    </>
  );
};

export default Detail;
